import React, { useState, useEffect } from "react";
import Iframe from 'react-iframe'


export default function Videos({ videos }) {
  return (
    <div>
      {videos &&
        videos.map((v) => {
          return <iframe width="300"  src={v.uri}></iframe>;
        })}
    </div>
  );
}
